import React from 'react';
import './style.css'; 
import { GiTrophyCup } from 'react-icons/gi';
import { AiOutlineSolution } from 'react-icons/ai';
import { FaBookReader } from 'react-icons/fa';
import { RxCountdownTimer } from 'react-icons/rx';
const services = () => {
  return (
    <div className="services-container">
      <h1 className="services-heading">Special about test series</h1>
      <div className="services-grid">
      <div className="service-box">
          <GiTrophyCup className='service-icon'/>
          <p>Service 1</p>
        </div>
        <div className="service-box">
          <AiOutlineSolution className='service-icon'/>
          <p>Service 2</p>
        </div>
        <div className="service-box">
          <FaBookReader className='service-icon'/>
          <p>Service 3</p>
        </div>
        <div className="service-box">
          <RxCountdownTimer className='service-icon'/>
          <p>Service 4</p>
        </div>
      </div>
    </div>
  );
};

export default services;
